import React, { useContext, useState } from "react";
import ExitToAppIcon from "@material-ui/icons/ExitToApp";
import "../styles.css";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";
import AuthContext from "../context/auth/authContext";

export default function Navbar1(props) {
  const authContext = useContext(AuthContext);
  if (!authContext) return null;

  const { logout, isAuthenticated } = authContext;
  const [language, setLanguage] = useState("en");

  const handleLogout = () => {
    logout();
    window.location.href = "/auth";
  };

  const handleLanguageChange = (e) => {
    setLanguage(e.target.value);
    // لو عندك Context للغة يمكن تحديثه هنا
  };

  return (
    <Navbar
      style={{
        position: "sticky",
        top: "0",
        zIndex: "100000",
        display: "flex",
        justifyContent: "space-between",
        fontFamily: "Mulish",
      }}
      bg="primary"
      variant="dark"
    >
      <Navbar.Brand className="navbar titl">
        <Link to="/" style={{ color: "white", fontFamily: "Mulish" }}>
          Syrian Flight <i className="fas fa-utensils" />
        </Link>
      </Navbar.Brand>

      <Nav style={{ display: "flex", alignItems: "center" }}>
        <div className="navLogout">
          <Link to="/" style={{ color: "white", textDecoration: "none" }}>
            <span className="bg_grey">Home</span>
          </Link>
        </div>

        {isAuthenticated && (
          <>
            <div className="navLogout">
              <Link to="/order" style={{ color: "white", textDecoration: "none" }}>
                <span className="bg_grey">Orders</span>
              </Link>
            </div>

            <div className="navLogout">
              <Link to="/addproduct" style={{ color: "white", textDecoration: "none" }}>
                <span className="bg_grey">Add Items</span>
              </Link>
            </div>

            <div className="navLogout">
              <Link to="/deleteitems" style={{ color: "white", textDecoration: "none" }}>
                <span className="bg_grey">Delete Items</span>
              </Link>
            </div>

            <div className="navLogout">
              <Link to="/contact" style={{ color: "white", textDecoration: "none" }}>
                <span className="bg_grey">Contact Us</span>
              </Link>
            </div>

            <div className="navLogout">
              <button
                type="button"
                onClick={handleLogout}
                style={{ border: "none", outline: "none", color: "white" }}
              >
                Logout <ExitToAppIcon />
              </button>
            </div>
          </>
        )}

        {/* قائمة اختيار اللغة - تصميم احترافي */}
        <div className="navLogout">
          <select
            value={language}
            onChange={handleLanguageChange}
            style={{
              padding: "0.4rem 0.8rem",
              borderRadius: "0.5rem",
              border: "none",
              backgroundColor: "#1099eeff", // سماوي فاتح
              color: "#000",
              fontWeight: "500",
              cursor: "pointer",
              fontFamily: "Mulish",
              transition: "all 0.3s ease",
            }}
            onMouseOver={(e) => (e.target.style.backgroundColor = "#00BFFF")}
            onMouseOut={(e) => (e.target.style.backgroundColor = "#87CEFA")}
          >
            <option value="en">English</option>
            <option value="ar">العربية</option>
          </select>
        </div>

        <span className="hamburger">
          <i onClick={props.changeDisplay} className="fa fa-bars" aria-hidden="true" />
        </span>
      </Nav>
    </Navbar>
  );
}
